const Item = require("../models/Item");
const Step = require("../models/Step");
const Image = require("../models/Image");
const WI = require("../models/WI");
const mongoose = require("mongoose");

const generatePositionData = () => {
  const num1 = Math.random() * (0.9).toFixed(7);
  const num2 = num1 + Math.random() * (0.1).toFixed(7);

  const num3 = Math.random() * (0.9).toFixed(7);
  const num4 = num3 + Math.random() * (0.1).toFixed(7);

  return { xStart: num1, zStart: num3, xEnd: num2, zEnd: num4 };
};

const deleteDB = async (req, res) => {
  await mongoose.connection.db.dropDatabase();
  return res.status(200).json({ status: "completed", info: "Dropped DB" });
};

const populateDB = async (req, res) => {
  if ((await mongoose.connection.db.collections()).length != 0) {
    return res.status(400).json({
      status: "failed",
      info: "Collections exist in DB. Please delete collections and try again.",
    });
  }
  const imagePCB = await Image.create({
    imageName: "PCB.png",
    imageData:
      "",
    mimeType: "image/png",
    encoding: "base64",
  });

  const imageBread = await Image.create({
    imageName: "bread.png",
    imageData:
      "",
    mimeType: "image/png",
    encoding: "base64",
  });

  const imageCat = await Image.create({
    imageName: "cat.png",
    imageData:
      "",
    mimeType: "image/png",
    encoding: "base64",
  });

  const imageLED = await Image.create({
    imageName: "LED.jpeg",
    imageData:
      "",
    mimeType: "image/jpeg",
    encoding: "base64",
  });

  const resistor = await Item.create({ name: "Resistor" });
  const led = await Item.create({ name: "LED" });
  const capacitor = await Item.create({ name: "Capacitor" });
  const diode = await Item.create({ name: "Diode" });
  const jumper = await Item.create({ name: "Jumper" });
  const transistor = await Item.create({ name: "Transistor" });
  const sw = await Item.create({ name: "Switch" });

  const stepResistor = await Step.create({
    text: "Insert the Resistor",
    item: resistor._id,
    positions: [generatePositionData(), generatePositionData()],
  });

  const stepLED = await Step.create({
    text: "Insert the LED (with the long leg in the first position).",
    item: led._id,
    positions: [generatePositionData(), generatePositionData()],
    image: imageLED._id,
  });

  const stepCapacitor = await Step.create({
    text: "Insert the capacitor (with the long leg in the first position).",
    item: capacitor._id,
    positions: [generatePositionData(), generatePositionData()],
  });

  const stepDiode = await Step.create({
    text: "Insert the diode (with the positive side in the first position).",
    item: diode._id,
    positions: [generatePositionData(), generatePositionData()],
  });

  const stepJumper = await Step.create({
    image: imageCat._id,
    text: "Insert the jumper cable.",
    item: jumper._id,
    positions: [generatePositionData(), generatePositionData()],
  });

  const stepTransistor = await Step.create({
    text: "Insert the transistor",
    item: transistor._id,
    positions: [
      generatePositionData(),
      generatePositionData(),
      generatePositionData(),
      generatePositionData(),
      generatePositionData(),
      generatePositionData(),
    ],
  });

  const stepSwitch = await Step.create({
    text: "Insert the switch.",
    item: sw._id,
    positions: [
      generatePositionData(),
      generatePositionData(),
      generatePositionData(),
    ],
  });

  const manySteps = [];
  for (let i = 0; i < 50; i++) {
    manySteps.push(
      await Step.create({
        text: `This is repeated step #${i}.`,
        item: resistor._id,
        positions: [generatePositionData(), generatePositionData()],
      })
    );
  }

  const motorBonnet = await WI.create({
    image: imagePCB._id,
    name: "PCB example",
    steps: [
      stepLED._id,
      stepJumper._id,
      stepLED._id,
      stepSwitch._id,
      stepResistor._id,
    ],
    dimensions: {
      xLengthCM: 6.49,
      yLengthCM: 1.1,
      zLengthCM: 3.048,
    },
  });

  const breadBoard = await WI.create({
    image: imageBread._id,
    name: "Breadboard example",
    steps: [
      stepLED._id,
      stepSwitch._id,
      stepResistor._id,
      stepDiode._id,
      stepCapacitor._id,
      stepTransistor._id,
    ],
    dimensions: {
      xLengthCM: 16.3,
      yLengthCM: 1.2,
      zLengthCM: 5.5,
    },
  });

  const many = await WI.create({
    image: imageCat._id,
    name: "Many Steps example",
    steps: manySteps.map((step) => {
      return step._id;
    }),
    dimensions: {
      xLengthCM: 16.3,
      yLengthCM: 1.3,
      zLengthCM: 5.5,
    },
  });

  return res.status(201).json({ status: "success" });
};

module.exports = {
  populateDB,
  deleteDB,
};
